import React from "react";

function Header() {
  return (
    <div id="toy-header">
      <img
        src="https://creativemarket.com/wonderkid/4365583-Logo-Design-for-Film-Studio"
        alt="toy header"
      />
      <h1>My Movies</h1>
    </div>
  );
}

export default Header;
